import {
  BrowserRouter as Router,
  Routes,
  Route,
} from "react-router-dom";



import './App.css';
import Header from './components/Header';
import NotesListPage from './pages/NotesListPage';

function App() {
  return (
    <Router>
      <Routes>
          <div className="App">

            <Route exact path="/" Component={NotesListPage}  />
          </div>
      </Routes>
    </Router>

  );
}

export default App;
